import React from 'react'
import { useNavigate } from 'react-router-dom'

function Index({ people, setPerson }) {
    const nav = useNavigate()
    const getPerson = (person)=>{
        setPerson(person)
        nav('/index/:')
    }

    let content = people.map(ele => {
        return <div key={ele.id}>
            <li onClick={getPerson.bind(this,ele)}>{ele.name}</li>
        </div>
    })
    return (
        <div className='app'>
            <h1>Index</h1>
            {people && <ul>
                {content}
            </ul>}
        </div>
    )
}

export default Index
